import { Route, Switch, useRouteMatch } from "react-router";

function AnnonceRoute() {
    var { categoryId } = useParams();
    var { path } = useRouteMatch();
    return(
        <Switch>
            <Route path={path + "/111"}>
                <h1>Torget</h1>
            </Route>
            <Route path={path + "/222"}>
                <h1>Bil</h1>
            </Route>
        </Switch>
    )
}

export default AnnonceRoute;
